import React from 'react'

function VendorScreen() {
    return (
        <div style={{marginTop: 30, textAlign:'center'}}>
          <h4 style={{ marginTop:20, textAlign:'center'}}><b style={{color:'red'}}>Sorry</b>!  You are not allowed to access this page.</h4>
           <img src='data:image/jpeg;base64,'
           style={{height: 400, marginTop:30}}></img>
        </div>
    )
}

export default VendorScreen
